import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import ListadoPacientes from "./pacientes/ListadoPacientes";
import Navbar from "./comunes/Navbar";
import Footer from "./comunes/Footer";
import "./styles.css";

function App() {
  return (
    <Router>
      <div classNameName="App">
        <Navbar />
        <div classNameName="container">
          <Routes>
            <Route path="/" element={<Inicio />} />
            <Route path="/pacientes" element={<ListadoPacientes />} />
            {/* Agrega más rutas aquí */}
          </Routes>
          <li>
            <Link to="/pacientes">Lista de Pacientes</Link>
          </li>
        </div>
        <Footer />
      </div>
    </Router>
  );
}

function Inicio() {
  return (
    <div>
      {/* Encabezado */ }
      <header className="py-3">
        <div className="container">
          <div className="row bg-light rounded-3 text-center">
            <div className="m-2 m-lg-3">
              <h1 className="fs-3 fw-bold">
                Bienvenido a{" "}
                <span className="text-success fw-bold fs-2">SIPRESS</span>
              </h1>
              <p className="fs-6">
                El Sistema Integral para la Prestación de Servicios de Salud
                -SIPRESS es una aplicación diseñada para simplificar la gestión
                de las Instituciones Prestadoras de Salud (IPS). Facilita el
                registro de pacientes y usuarios, así como la manipulación de
                historiales médicos y el control de la información relacionada.
                Su objetivo principal es mejorar la atención y la eficiencia en
                la prestación de servicios hospitalarios.
              </p>
            </div>
          </div>
        </div>
      </header>
      <h2>Página de Inicio</h2>
      <p>Bienvenido a la aplicación SIPRESS.</p>
      {/* Agrega más contenido aquí */}
    </div>
  );
}

export default App;
